import React from 'react'
import Header from './Header'
import PageBody from './PageBody'

const PageWrapper = () => {
  return (
    <div className="page-wrapper compact-wrapper" id="pageWrapper">
      <Header />
      <PageBody />
    </div>
  )
}

export default PageWrapper
